import { Grid } from "@mui/material";
import React from "react";

// Import your background image
import background from "../Images/background.jpg";

const Home = () => {
  const containerStyle = {
    backgroundImage: `url(${background})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    minHeight: '100vh',  // Ensure the background covers the entire viewport height
  };

  return (
    <>
      <Grid container justifyContent='center' style={containerStyle}>
        <Grid item sm={10} style={{ padding: '20px' }}>
          <h1 style={{ fontFamily: 'monospace' }}>Home</h1>
          <hr />
          <p>Home Lorem, ipsum dolor sit amet consectetur adipisicing elit. Sint iure nulla temporibus, consequatur quaerat repellat at velit architecto! Cum dicta repudiandae ratione laborum nam, neque exercitationem fugit enim nihil voluptates iste? Debitis natus voluptate nisi nobis mollitia doloribus quas obcaecati ea nostrum maxime! Non, omnis vero debitis fuga illum accusamus.</p>
        </Grid>
      </Grid>
    </>
  );
}

export default Home;
